theme.css:
.shrink .quote {
	background-position: 0px 20px;
}
.shrink .quotetitle, .shrink .quotetext {
	padding-left: 30px;
}
svg .igc-pie-center-text .igc-pie-center-text-node {
	font-family: PT Sans Narrow;
	fill: #4f4f4f;
	font-weight: 700;
	font-size: 27px;
}
.igc-x-axis-text text {
	font-family: PT Sans !important;
	font-size: 14px !important;
}
.igc-y-axis-text text {
	font-family: PT Sans Narrow !important;
	font-size: 14px !important;
}
.igc-sheets {
	text-align: center;
}
.igc-sheets .igc-sheet .igc-sheet-label,
.igc-sheets .igc-sheet:hover .igc-sheet-label,
.igc-sheets .igc-sheet.active .igc-sheet-label {
	color: #4f4f4f;
	font-weight: 400;
	font-size: 16px;
	font-family: PT Sans Narrow;
}
.igc-sheets .igc-sheet .igc-sheet-ico,
.igc-sheets .igc-sheet:hover .igc-sheet-ico {
	background: transparent;
	border-color: #4f4f4f;
}
.igc-sheets .igc-sheet.active .igc-sheet-ico::after,
.igc-sheets .igc-sheet:hover .igc-sheet-ico::after {
	height: 14px;
	width: 14px;
	left: 2px;
	top: 2px;
	background: #4f4f4f;
}
.igc-textual-figure {
	font-family: PT Sans Narrow;
	font-size: 60px;
	font-weight: 700;
}
.igc-textual-fact {
	font-family: PT Sans Narrow;
	color: #4f4f4f;
	font-weight: 400;
	font-size: 25px;
	line-height: 30px;
}
.igc-table {
	color: #555e67;
	font-family: PT Sans Narrow;
	font-weight: 400;
	font-size: 15px;
}
.igc-table .igc-table-cell {
	border-color: #e9e9e9;
	border-style: solid;
	border-width: 1px;
	font-family: PT Sans;
	font-weight: 400;
	font-size: 12px;
}
.igc-table .igc-table-header {
	font-family: PT Sans;
	font-weight: 400;
	font-size: 12px;
}
.ig-container {
	background: #fff;
}
.headline {
	font-family: PT Sans Narrow;
	font-size: 45px;
	line-height: 40px;
	text-transform: uppercase;
	font-weight: 700;
	color: #131313;
	border-bottom: 2px solid #131313;
}
.chart-title {
	font-family: PT Sans Narrow;
	font-size: 32px;
	color: #131313;
	line-height: 28px;
	font-weight: 700;
}
.bodytext {
	font-family: PT Sans;
	font-size: 16px;
	line-height: 24px;
	color: #131313;
	font-weight: 400;
	text-align: justify;
}
.quote {
	font-family: PT Sans Narrow;
	font-size: 33px;
	text-align: left;
	color: #131313;
	border-top: 2px solid #131313;
	border-bottom: 2px solid #131313;
	font-weight: 700;
	background: url(/i/templates/160/quote.svg) 20px 20px no-repeat;
	background-size: 15px 15px;
	padding: 20px;
	padding-left: 50px;
	line-height: 37px;
}
.quotetitle {
	font-size: 33px;
	margin-top: 5px;
	font-weight: 400;
	line-height: 47px;
}
.tt_tooltip {
	font-family: PT Sans Narrow;
	font-size: 14px;
	color: #fff;
	font-weight: 700;
}
.tt_text {
	font-weight: 400;
}
.tick line,
line.border {
	stroke: #f2f2f2 !important;
}
.ig-copyright {
	text-align: left;
	word-break: break-all;
	margin-bottom: 5px;
}
.ig-logo-image,
#madewith {
	display: none;
}
.ig-logo {
	background: url(https://s3.amazonaws.com/infogram-themes/159/logo.png) right bottom no-repeat;
	background-size: 189px 45px;
	width: 189px;
	height: 45px;
}
#footer {
	margin-left: 20px;
	margin-right: 20px;
	min-height: 60px !important;
}
.shrink .chart > .inner {
	padding-left: 10px;
	padding-right: 10px;
}
.shrink .chart {
	margin-left: 0;
	margin-right: 0;
}
.ig-separator-line {
	background: rgba(79, 79, 79, 0.5);
}
.heatmap-legend {
	background: rgba(255, 255, 255, 0.7);
}
.heatmap-legend-item,
.heatmap-label {
	color: #4f4f4f;
	font-size: 11px;
	font-weight: 400;
	font-family: PT Sans;
}
.igc-graph-pie-piece {
	stroke: rgba(255, 255, 255, 0.7);
}
.tt_tooltip .tt_body {
	background: #373636;
}
.tt_tooltip .tt_left {
	border-right: 8px solid #373636;
}
.tt_tooltip .tt_right {
	border-left: 8px solid #373636;
}
.igc-tabs .igc-tab-active {
	background: #fff;
}
.igc-tabs .igc-tab .igc-tab-content,
          .igc-tabs .igc-tab.icon-down:after {
	font-family: PT Sans Narrow;
	color: #4f4f4f;
	font-weight: 400;
}
.igc-tabs .igc-tab,
          .igc-tab-switcher {
	color: #4f4f4f;
}
.igc-tabs.igc-tabs-dropdown .igc-tab-name {
	font-family: PT Sans Narrow;
	color: #4f4f4f;
}
.captiontext {
	font-family: PT Sans Narrow;
	color: #4f4f4f;
	font-weight: 400;
}
.captiontext .innertext {
	line-height: 1.5;
}
.tooltip-map-group-name {
	display: none;
}
.igc-tab-ico svg path {
	fill: #4f4f4f;
}
.igc-tab-switcher-ico svg path {
	fill: #4f4f4f;
}
.igc-table-search {
	color: #4f4f4f;
	font-size: 16px;
	font-weight: 400;
	font-family: PT Sans Narrow;
}
